{
  "$schema": "http://json-schema.org/draft-07/schema#",
  "title": "Feedback Sentiment Output Schema",
  "description": "Schema for parsing AI sentiment analysis results from customer feedback submissions.",
  "type": "object",
  "properties": {
    "customer_name": {
      "type": "string",
      "description": "Name of the customer submitting feedback."
    },
    "customer_email": {
      "type": "string",
      "description": "Email of the customer submitting feedback."
    },
    "feedback_text": {
      "type": "string",
      "description": "Raw feedback text provided by the customer."
    },
    "sentiment": {
      "type": "string",
      "enum": ["positive", "neutral", "negative"],
      "description": "Predicted sentiment label of the feedback."
    },
    "confidence_score": {
      "type": "number",
      "minimum": 0,
      "maximum": 1,
      "description": "Model confidence score for the sentiment classification (0-1)."
    },
    "key_phrases": {
      "type": "array",
      "items": { "type": "string" },
      "description": "Important keywords or topics extracted from the feedback."
    },
    "summary": {
      "type": "string",
      "description": "A short AI-generated summary of the feedback."
    },
    "alert_priority": {
      "type": "string",
      "enum": ["high", "medium", "low"],
      "description": "Priority level for team alerting based on sentiment and urgency."
    },
    "timestamp": {
      "type": "string",
      "format": "date-time",
      "description": "Time when the feedback was received."
    }
  },
  "additionalProperties": false
}

