parameters.inputSchema:
{
  "$schema": "https://json-schema.org/draft/2020-12/schema",
  "title": "SurveyTopicKeywordExtraction",
  "description": "Schema for extracting topics, keywords, and sentiment insights from Jotform survey responses.",
  "type": "object",
  "properties": {
    "topics": {
      "type": "array",
      "description": "High-level themes or categories extracted from the survey answers.",
      "items": {
        "type": "object",
        "properties": {
          "topic": {
            "type": "string",
            "description": "Descriptive name of the topic, e.g., 'Customer Support Experience'."
          },
          "summary": {
            "type": "string",
            "description": "Short summary describing this topic based on the responses."
          },
          "keywords": {
            "type": "array",
            "description": "List of key terms or phrases related to this topic.",
            "items": {
              "type": "string"
            }
          },
          "sentiment": {
            "type": "string",
            "enum": ["positive", "negative", "neutral", "mixed"],
            "description": "Overall sentiment associated with this topic."
          },
          "importance_score": {
            "type": "number",
            "minimum": 0,
            "maximum": 1,
            "description": "Relative importance or weight of this topic (0-1 scale)."
          }
        },
        "required": ["topic", "keywords"]
      }
    },
    "global_keywords": {
      "type": "array",
      "description": "Top-level keywords or phrases representing the overall survey themes.",
      "items": {
        "type": "string"
      }
    },
    "insights": {
      "type": "array",
      "description": "Key takeaways or AI-generated insights derived from the data mining.",
      "items": {
        "type": "string"
      }
    },
    "generated_at": {
      "type": "string",
      "format": "date-time",
      "description": "Timestamp of when this analysis was generated."
    }
  }
}
